@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("scour.com") {

/***********************************************************************************/
/* Global styles
/***********************************************************************************/
  body, .resultContent, .resultTitleRow, .resultSummary, .searchbox, .resultCommentsContainer, .resultCommentsContainer > strong, .adbarad, embed

   {
     background: #222 !important;
     color: #bbb !important;
   }

input[type="text"]
   {
      background: #DDDDDD !important;
   }
  
  a:link, a:link > strong
   {
     color: #55ff55 !important;
   }
  a:visited, a:visited > strong
   {
     color: #227722 !important;
   }

/* hide "Sponsered Link" */
 #featuredAds {display:none !important;}

/* let results use entire page width */
td[width="26%"] {width: 0% !important;}

  
/***********************************************************************************/
/* header
/***********************************************************************************/
  .toplinkmenu > a:hover, #welcome_user > a:hover, #welcome_user > span > a:hover
   {
     border-bottom-color: #222 !important;
     text-decoration:none !important;
   }
 .toplinkmenu > a, .toplinkmenu > a > strong
 {
 color: #272 !important;
 }
 
  #welcome_user > strong
   {
     color: #bbb !important;
   }

 #entries-box
 {
     background: #333 !important;
     border: solid #777 1px !important;
    -moz-border-radius: 15px !important ;
 }

/***********************************************************************************/
/* search tabs
/***********************************************************************************/
  .searchtabs > a
   {
     background: #222 !important;
     color: #5F5 !important;
     border: 1px solid #996633 !important;
     margin-left: 5px;
   }

   .searchtabs > .activetab
   {
      background: #444 !important;
      border: 1px solid #996633 !important;
   }

/***********************************************************************************/
/* sub-menu
/***********************************************************************************/
  #submenu
   {
     background-image:
       url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAkCAYAAABIdFAMAAAAAXNSR0IArs4c6QAAAAZiS0dEAAAAAAAA+UO7fwAAAAlwSFlzAAALEwAACxMBAJqcGAAAAAd0SU1FB9gKGAI6JYCNjWMAAABVSURBVAjXhYqxDQMxEMNouXDhEbxs4J1dRHrgvkmKR4o0AkGKvXf11tpL5xy01kJzTjTGQL13JAkB/6aqvkShvIN8BV02so2coCQoztP5E2w/Lr/hBsJUQJwgKhJxAAAAAElFTkSuQmCC")

       !important;
     background-position: top left !important ;
     background-repeat: repeat-x !important ;
     background-color: #222 !important;
     border-left: 1px solid #444 !important;
     border-right: 1px solid #444 !important;
     border-top: 1px solid #000 !important;
     border-bottom: 1px solid #444 !important;
     color: #bbb !important;
     padding: 0 !important;
     text-indent: 20px !important;
   }

  .submenuTitle > a
   {
     line-height: 170% !important;
    }

  .sortByScour, .sortByGoogle, .sortByYahoo, .sortByLive
   {
     margin-left: 3px !important;
   }

  .sortByScour_selected, .sortByGoogle_selected, .sortByYahoo_selected, .sortByLive_selected
   {
     border: solid 1px #888 !important;

   }

/***********************************************************************************/
/* Results
/***********************************************************************************/
  .resultTitle, .resultTitle > strong
   {
     background: #333 !important;
   }

.resultTitleRow
   {
     margin-top: 1px;
   }

  .resultMainBorder, .resultTitle, .resultRank
  {
     border-color: #999 !important;
  }
 
  .resultComments
   {
     background: #222 !important;
     color: #55ff55 !important;
   }

  .resultSummary > strong, a > strong /* search terms */
   {
     font-weight: bold !important;
   }

/***********************************************************************************/
/* comment section */
/***********************************************************************************/
.addCommentErrors, .addCommentPanel
   {
     background: #222 !important;
     color: #cc5555 !important;
   }

.comMain, .myCom, .myComInfo
   {
     background: #333 !important;
     color: #ee3333 !important;
     border-color: #BEDAB1 !important;
   }

  .addCommentButton, .commentLowerClose, .commentLowerCloseTop, #mpbl_close, #mpbl_moreinfo
   {
    background-color: #282827 !important;
    background-image: url(data:image/png;base64,) !important;
    background-repeat: repeat-x !important ;
    -moz-border-radius: 10px !important ;
    border-color: black !important;
    margin-top: 2px !important;
    color: #003000 !important;
   }

  .addCommentButton:hover, .commentLowerClose:hover, .commentLowerCloseTop:hover,
  #mpbl_close:hover, #mpbl_moreinfo:hover
   {
    background-color: #848483 !important;
    background-image: url(data:image/png;base64,) !important;
    background-repeat: repeat-x !important ;
    -moz-border-radius: 10px !important ;
   }

.myComTip
   {
     background-image: url(data:image/png;base64,) !important;
     background-position: top left !important;
   }

/***********************************************************************************/
/* point box */
/***********************************************************************************/

   #mpbl, .mpbl_column
   {
     background: #222 !important;
     border-color: #444 !important;
   }

   #mypoints_total_s /* shadow effect */
   {
   color: #777 !important;
   }
  
/***********************************************************************************/
/* Tip section */
/***********************************************************************************/
#scour-tip, #scour-tip-msg > strong
   {
     background: #730 !important;
     color: #C29142 !important;
   }

/***********************************************************************************/
/* pager */
/***********************************************************************************/
   a[title="View Page 1"], a[title="View Page 2"], a[title="View Page 3"], #pagerNext, #pageNext, #pagerPrev
   {
      background: #222 !important;
font-weight: normal !important;
      border-color: #996633 !important;
   }

  .nextprev
   {
      background: #444 !important;
      border-color: #996633 !important;
   }

/***********************************************************************************/
/* Profile pages */
/***********************************************************************************/


  div > strong, div > strong > strong, div > strong > strong > strong,
  div > strong > strong > strong > strong, td > strong
   {
    color: #bbb !important;
    font-weight: bold !important;
   }

#setContent, p
   {
    border-color: #222 !important;
    color: #999 !important;
   }

table.setPointStats td
   {
    border-color: #444 !important;
    color: #999 !important;
   }

tr.zebra td
   {
    background-color: #444 !important;
   }

tr.highlight td
   {
    background-color: #4B4B2F !important;
    font-weight: bold !important;
   }

.pointTotal
   {
    color: #999 !important;
   }

div.friendActivity
   {
    border-color: #2a2a2a !important;
   }

#setContent h2, #setPanelTop, #setTabsTop, #setPanelBase, .content_box,
.content_box_top, .content_box_bottom, .editProCol
   {
    background: #222 !important;
   }

.lead_row, .editProCol fieldset
   {
     background: #333 !important;
   }

.editProCol legend
  {
    color: #3984AB !important;
  }

#tafOverlay, .iBanner
   {
     background: #333 !important;
     border: 1px solid #999 !important;
     -moz-border-radius: 10px !important;
   }

.inviteSectDesc, .h2desc, .setCashoutCurrent
   {
     background: #333 !important;
     color: #BFC775 !important;
     border: 1px solid #BFC775 !important;
     -moz-border-radius: 10px !important;
   }

/***********************************************************************************/
/* Blog */
/***********************************************************************************/
#masthead, #nav, #masthead > h1

  {
    background: #333 !important;
    border-color: #555 !important;
  }

#nav * > a:hover
  {
     padding-top:2px!important;
    background-image: url("data:image/gif;base64,R0lGODlhDwALAKEDACIiIjMzM1VVVf///yH5BAEAAAMALAAAAAAPAAsAAAIdjI8pkr0AWDMCWqnsnVVDTHkb0onRUZpnqjJsaxYAOw==")
 !important;
  }

.posts * > strong
  {
    font-weight: bold !important;
    color: #D0D0D0 !important;
  }

.posts > h2
  {
    color: #272 !important;
  }

.posts * > h3
  {
    color: #D0D0D0 !important;

  }


/***********************************************************************************/
/* replace images */
/***********************************************************************************/
.sortByScour, .sortByGoogle, .sortByYahoo, .sortByLive,
.resultNewWindow, .resultVoteUp, .resultVoteDown, .resultCommentsArrow,
.addCommentPostPos, .addCommentPostNeg, .resultComments > span,
.resultLiveRank > span, .resultLiveRankNone > span,
.resultGoogleRank > span, .resultGoogleRankNone > span,
.resultYahooRank > span, .resultYahooRankNone > span
   {
     background-image: url("data:image/png;base64,") !important;

   }

#mypointsbox, #mpbl_logo
   {
     background-image: url("data:image/png;base64,") !important;
   }

img[src*="/images/logo.gif"], #setLogo
   {
     height:55px!important;
     padding-right:158px!important;
     width:0!important;
     background-repeat: no-repeat !important;
     background-position: top left !important;
     background-image: url("data:image/gif;base64,") !important;
   }

.shiny_button
   {
     background-position: top left !important;
     /* shiny_button.gif */
     background-image: url(http://qwertyful.com/img/stylish/shiny_button.gif) !important;
   }
/***********************************************************************************/
/* Profile top tabs */
/***********************************************************************************/
#setTabsTop li.setTabsTopStart
  {
    background-image: url(data:image/gif;base64,) !important;
  }

#setTabsTop li.setTabsTopEnd
  {
    background-image: url(data:image/gif;base64,) !important;
  }

#setTabsTop li.selected
{
  background-image: url(http://qwertyful.com/img/stylish/activetab.gif) !important;
  background-repeat: no-repeat !important;
  background-position: top left !important;
}

#setTabsTop li
{
  background-image: url(data:image/gif;base64,R0lGODlhAQAoAIQdACYnJyoqKiwsLC4tLi8vMDAxMDMzMzQ0MzQ0NDc3Nzc4ODk5OTo6Ojs7Oz4+Pj8/P0FAQUJDQ0REREdGR0dHR0pLSkpLS0xLS05OTk9OT1FRUVJTUlVUVVVVVVVVVVVVVSH+EUNyZWF0ZWQgd2l0aCBHSU1QACH5BAEKAB8ALAAAAAABACgAAAUd4CeOI7BcnIZZlAQ5TIIUQyAQh9I80VRlm47EEAIAOw==) !important;
  background-repeat: repeat-x !important;
  background-position: top left !important;
}

/***********************************************************************************/
/* Profile side tabs */
/***********************************************************************************/
#setTabsSide li a
{
  background-image: url(data:image/png;base64,) !important;
  -moz-border-radius: 15px !important;
  border: solid 1px #3984AB !important;
  color: #307185 !important;

}

#setTabsSide li
{
  margin-top: 7px !important;
  -moz-border-radius: 15px !important;

}

#setTabsSide li.selected a
{
  background-color: #444 !important;
  -moz-border-radius: 15px !important;
   border: dashed #BF5E24 1px !important;
   color: #BF5E24 !important;
}

/* hide feedback logo under side tabs */
a#userprofilefeedback
{
  display:none !important;
}
}
